import * as React from 'react';
import {Box,Container} from '@mui/material';
import { useTheme } from '@mui/material/styles';
import MobileStepper from '@mui/material/MobileStepper';
import Paper from '@mui/material/Paper';
import Typography from '@mui/material/Typography';
import Button from '@mui/material/Button';
import KeyboardArrowLeft from '@mui/icons-material/KeyboardArrowLeft';
import KeyboardArrowRight from '@mui/icons-material/KeyboardArrowRight';

const steps = [
  {
    label: 'Select campaign settings',
    description: `For each ad campaign that you create, you can control how much
              you're willing to spend on clicks and conversions, which networks
              and geographical locations you want your ads to show on, and more.`,
  },
  {
    label: 'Create an ad group',
    description:
      'An ad group contains one or more ads which target a shared set of keywords.',
  },
  {
    label: 'Create an ad',
    description: `Try out different ad text to see what brings in the most customers,
              and learn how to enhance your ads using features like ad extensions.
              If you run into any problems with your ads, find out how to tell if
              they're running and how to resolve approval issues.`,
  },
];

export default function TextMobileStepper() {
  const theme = useTheme();
  const [activeStep, setActiveStep] = React.useState(0);
  const maxSteps = steps.length;

  const handleNext = () => {
    setActiveStep((prevActiveStep) => prevActiveStep + 1);
  };

  const handleBack = () => {
    setActiveStep((prevActiveStep) => prevActiveStep - 1);
  };

  return (
    <Container maxWidth={false} disableGutters sx={{ background:"#2a2a2a"}}>
 <Container>
 <Box sx={{
                    flexGrow: 1,
                    paddingTop: isLgMatch ? "20%" : 'auto',paddingTop:'7%',paddingBottom:'5%',
                    
                }}>
                    
                    <Grid container spacing={2}>
                        <Grid spacing={0}
                            direction="column" item xs={12} lg={6} sx={{placeSelf: 'center',display:'flex',paddingTop:isSmMatch?30:0 }}>
                            <Box sx={{
                                margin: '0px auto',
                                width: isSmMatch?'70%':'25%',
                                border: '4px solid #f5af31',
                                padding: '10px 10px 20px 25px'
                            }}>
                                 <Rotate top left>
                                <CardMedia
                                    component="img"
                                    sx={{
                                        width: isLgMatch ? '100%' : 'auto',
                                        objectFit: 'cover',
                                        height: 350,
                                        border: '10px solid #444',
                                        marginTop: -5
                                    
                                    }}
                                image={isLgMatch ? innerjpg : innerjpg}
                                alignItems='right'
                                alt="Live from space album cover"
              /></Rotate></Box>
                        </Grid>
                        <Grid container
                            spacing={0}
                            direction="column"
                            textAlign={isLgMatch ? 'center' : 'left'}
                            style={{
                                justifyContent: "center", padding: "2% 2%", alignContent: 'center',
                                alignItems: isLgMatch ? 'center' : 'auto'
                            }} item xs={12} lg={6}>
                                <Fade top>
                                 <Box sx={{ typography: isLgMatch?'h5':'h3', color: '#fff' }} className={classes.root}>About Me</Box></Fade>
                                 <Fade bottom>   <Box sx={{ typography: 'p', color: '#a8a8a8',marginTop:2 }}>I am skilled in React Native , React.Js , Javascript , HTML , CSS  have worked with both web-based, multi-threaded applications as well as front-end development using the latest web technologies and good in developing customer service-oriented applications with solid test automation strategies.

In past have worked on both service and project side in service projects utilizing  Blockchain technologies like Trade , Swap ,Liquidity , stake , NFT and in product game platform like Dream11 ,e-commerce moreover in React Native educational based app for students ,music app like Gaana.

</Box> <Box sx={{ typography: 'p', color: '#a8a8a8',marginTop:2 }}>
In addition to my skills in coding, I am skilled in conducting technical analysis as well as assisting clients in project management.</Box>

<Box sx={{ typography: 'p', color: '#a8a8a8',marginTop:2 }}>Software Engineer | React Developer | React Native Developer | Web Designer , Web Developer</Box>
                    </Fade>    </Grid>



                    </Grid>
                </Box>
    <Box sx={{ maxWidth: 400, flexGrow: 1 }}>
      <Paper
        square
        elevation={0}
        sx={{
          display: 'flex',
          alignItems: 'center',
          height: 50,
          pl: 2,
          bgcolor: 'background.default',
        }}
      >
        <Typography>{steps[activeStep].label}</Typography>
      </Paper>
      <Box sx={{ height: 255, maxWidth: 400, width: '100%', p: 2 }}>
        {steps[activeStep].description}
      </Box>
      <MobileStepper
        variant="text"
        steps={maxSteps}
        position="static"
        activeStep={activeStep}
        nextButton={
          <Button
            size="small"
            onClick={handleNext}
            disabled={activeStep === maxSteps - 1}
          >
            Next
            {theme.direction === 'rtl' ? (
              <KeyboardArrowLeft />
            ) : (
              <KeyboardArrowRight />
            )}
          </Button>
        }
        backButton={
          <Button size="small" onClick={handleBack} disabled={activeStep === 0}>
            {theme.direction === 'rtl' ? (
              <KeyboardArrowRight />
            ) : (
              <KeyboardArrowLeft />
            )}
            Back
          </Button>
        }
      />
    </Box></Container></Container>
  );
}
